import classes from './ArchiveClasses.module.css';

const ArchiveClasses = ({children, ...props}) => {
  return (
      <div {...props} className={classes.Classes}>
          {children}
          
      </div>
  )
}

export default ArchiveClasses;

const ArchiveItem = ({children, ...props}) => {
  return (
    <div {...props} className={classes.ClassesItem}>
      {children}
    </div>
  )
}
